import "./App.css";
import Navbar from "./Navbar";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Navbar />
      <div style={{textAlign: 'center'}}>
      <text style={{ fontSize: '30px', fontWeight: "bold"}} >PRO FUTSAL LEAGUE</text>
      </div>
    </div>
  );
}

export default App;
